import React from 'react';

function Header() {
  const headerStyle = {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100%',
    backgroundColor: '#f2f2f2',
    zIndex: 999,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '20px 0',
    fontFamily: 'Arial, sans-serif', // Change the font to Arial or any other professional font
  };

  const titleStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    color: '#333333',
    margin: 0,
  };

  return (
    <header style={headerStyle}>
      <h1 style={titleStyle}>Chris' Portfolio Page</h1>
      <nav>
        <ul style={{ display: 'flex', listStyleType: 'none', justifyContent: 'space-around' }}>
          <li><a href="#home">Home</a></li>
          <li><a href="#about">About</a></li>
          <li><a href="#projects">Projects</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
